    // const harvests = useContext(HarvestContext)
    // const getAllHarvests = useContext(HarvestContext)


    // useEffect(() => {

    //     getAllHarvests()



    // }, []
    // )



    return (
        <div>

            <h1>Current Available Harvests</h1>
            {props.harvests.map(harvest => <HarvestPhotos image={harvest.harvestImg} label={harvest.body} farmer={harvest.userHandle} {...harvest}
                key={Math.floor(Math.random() * Math.floor(1000))} />)}
        </div>
    )
}

export default HarvestList
